sources.components/Generation.js:
import React, { Component } from 'react';

class Generation extends Component {
    render (){
        const generation = { generationId : -999, expiration : '12/12/2100'};
        return (
            <div>
                <h4>Generation : {generation.generationId}.</h4>
                <h4>Expiration : {new Date (generation.expiration).toString()}</h4>
            </div>
        );
    }
}

export default Generation;
